script: |
  super -f text -I q8637.spq | sort > q8637.out

inputs:
  - name: q8637.spq
    data: |
      SELECT DISTINCT - - 32 * 5 FROM tab0 (FORMAT parquet) AS cor0 CROSS JOIN tab0 (FORMAT parquet), tab1 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab1

outputs:
  - name: q8637.out
    data: |
      160
